import React from 'react';
import { Row, Col} from 'reactstrap';
import '../css/home.css';


export default function Home () {
    return (
        <div className="Home">
            <Row>
                <Col xl="8">
                    <div className="stories">
                        <div className="story__list">
                            <div className="story__item">
                            </div>
                        </div>
                    </div>

                </Col>
                <Col xl="4">
                    <p>4</p>
                </Col>
            </Row>
        </div>
    );
}
